{"negative":{"rating":2,"review":"This feather duvet in cotton white solid offers excellent comfort and a stylish appearance, enhancing the overall bedroom aesthetic. However, it's worth noting that it produces noticeable noise when you move, which might be a consideration for those sensitive to sound disturbances. 

I would buy it again, knowing it makes noise similar to garbage bags in the middle of the night when you move? Definitely not."},"positive":{"rating":5,"review":"I recently spent a week at a 5 star resort and never slept so good. I quickly recreated the sleeping environment in my own home and now I'll always be on vacation! 
In the pic I pulled out the corner to verify the comforter is in the duvet. The comforter has loops for ties to secure the duvet in place which is helpful for keeping it from bunching up somewhere. My feet love it! It is lightweight and breathes with the room thermostat. Paradise!"}}
